import React, { Component } from "react";
import HeaderMenu from "./headermenu";
import Footer from "./footer";
import RiskHeader from "./riskHeader";
import CardContainer from "./cardConatiner";

export default class Home extends Component {
  constructor(props) {
    super(props);

    this.state = {
      empty:'Epmty variable'
    };
  }
  render() {
    console.log('history will be',this.props.history);
    return (
      <div>
       
        <div
          className="mainWrapperAsContainer main_content_sec"
          id="mainContent"
        >
          <CardContainer {...this.props}/>
        </div>
        <footer>
          <Footer />
        </footer>
      </div>
    );
  }
}
